
b64_string = ""
import base64
import numpy as np
import matplotlib.pyplot as plt

def base64_map_to_array(b64_data, new_width, new_height):
   
    decoded_data = base64.b64decode(b64_data)
    
    # Calculate the expected length in bytes (4 bytes per 32-bit integer)
    expected_length = new_width * new_height
    if len(decoded_data) != expected_length:
        raise ValueError(f"Decoded data length ({len(decoded_data)}) does not match "
                         f"expected size ({expected_length}) for dimensions {new_width}x{new_height}")
    
    # Convert the binary data to a NumPy array of little-endian 32-bit integers
    #array = np.frombuffer(list(decoded_data), dtype='<i8')
    array = np.array(list(decoded_data))
    # Reshape the 1D array into 2D (Note: images are typically (height, width))

    return array.reshape((int(new_width), int(new_height)))


new_width = 128 
new_height = 1024

try:
    # Convert base64 data into a 2D NumPy array
    image_array = base64_map_to_array(b64_string, new_width, new_height)
except ValueError as e:
    print("Error:", e)
else:
    # Display the image using matplotlib
    plt.imshow(image_array)
    plt.title("Decoded Image")
    plt.axis('off')  # Hide axis ticks and labels
    plt.show()
